import React from 'react';
import PropTypes from 'prop-types';
import TaskToggle from '../task-toogle/task-toggle';
import TaskButton from '../task-button/task-button';
import TaskLabel from '../task-label/task-label';

// eslint-disable-next-line react/prop-types
const Task = ({ className, display, text, deleteTask, editTaskValue, ...props }) => {
  // console.log(text);
  return (
    <div className={className} style={{ display }}>
      <TaskToggle text={text} className="toggle" type="checkbox" {...props} />
      <TaskLabel text={text} {...props} />
      <TaskButton text={text} taskBtnFn={editTaskValue} {...props} className="icon icon-edit" />
      <TaskButton text={text} taskBtnFn={deleteTask} {...props} className="icon icon-destroy"/>
    </div>
  );
};

Task.defaultProps = {
  className: 'view',
  display: 'block',
  editTaskValue: () => {},
  deleteTask: () => {},
};
Task.propTypes = {
  className: PropTypes.string,
  display: PropTypes.string,
  editTaskValue: PropTypes.func,
  deleteTask: PropTypes.func,
};

export default Task;
